/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import Item from './ListItem';
export default class List extends React.Component {
    render(){
        let {onClick,prefixCls} = this.props;
        return(
            <div className={prefixCls} onClick={()=>onClick}>
                {this.props.children}
        </div>
        )
    }
}
List.Item = Item;
